I wanted to share this message that @ashleighmariecolor posted to her story. It really hit home for me. For those of you who don’t know what to say about the current events in Israel, this is a great example.

Understand I am not a geopolitical expert. But I am a proud Jewish American with ties to my ancestral homeland, Israel. Seeing our non Jewish friends being vocal about your support of Israel and your disgust about the attack on innocent Israeli civilians brings us comfort. And it lets us, and the rest of the world, know that people care.

I wanted to share my thoughts as so many of you have been so kind and supportive. Here is a list of accounts that provide more information about what is happening in Israel and how you can help:
